import React from 'react';

function Balloons() {
  return (
    <section className="balloons-section">
      <div className="balloons">
        <div className="balloon balloon--pink"><div className="balloon-string"></div></div>
        <div className="balloon balloon--blue"><div className="balloon-string"></div></div>
        <div className="balloon balloon--yellow"><div className="balloon-string"></div></div>
        <div className="balloon balloon--purple"><div className="balloon-string"></div></div>
      </div>
    </section>
  );
}

export default Balloons;
